import React from 'react';
import User from './User'; 
import Card from './Card'; 

import './UserList.css';

const UserList = ({ users }) => {
  return (
    <Card className="users">
      <ul>
        {users.map((user, index) => (
          <li key={index}>
            <User
              id={user.id}
              img={user.image}
              name={user.name}
              age={user.age}
              major={user.major}
            />
          </li>
        ))}
      </ul>
    </Card>
  );
};

export default UserList;
